import React, { useState } from 'react';
import View from './components/View'; // Corrected path
import PaperCanvas from './components/PaperCanvas'; // Corrected path
import CreateGridBG from './components/CreateGridBG'; // Corrected path
import UploadFile from './interactions/UploadFile'; // Corrected path

const START_SCREEN = "paper";

function App() {
  const [appScreen, setScreen] = useState(START_SCREEN);
  const [paperReady, setPaperReady] = useState(false);

  return (
    <div className="App">
      {appScreen === "paper" && (
        <View icon="" goToScreen="" screen={appScreen} setScreen={setScreen}>
          <PaperCanvas setPaperReady={setPaperReady} />

          {paperReady && (
            <CreateGridBG 
              paper={paperReady} 
              paperReady={paperReady}
            />
          )}

          {/* Add the UploadFile component here */}
          <UploadFile />
        </View>
      )}
    </div>
  );
}

export default App;
